import React, { Component } from 'react';
import './App.css';
import Nav from './Nav';
import Upload from './Upload';
import Main from './Main';

// import { withRouter, Link } from 'react-router-dom';
import { BrowserRouter as Router, Switch, Route, Redirect } from 'react-router-dom';

class App extends Component {

state = {
  serverobject: []
}
submitURL = (e) => {
  e.preventDefault();
  const body= {
  imgURL: 'https://upload.wikimedia.org/wikipedia/commons/3/37/Dagestani_man_and_woman.jpg'
    }
      const init = {
      method: "POST",
      body: JSON.stringify(body),
      headers: {
      "content-type": "application/json"
  }};

  fetch("/upload", init)
  .then(resp => resp.json())
  .then(data => {
      debugger;
      console.log(data);
      this.setState({
      serverobject: data,
      })   
  })
  .catch( error => {
  console.log(error)
  })
}

  render() {
    return (

<div className="App">
  <Nav />
  <Router>
    <Switch>
      <Route path={"/upload"} 
      render={ (props) => { return <Upload props={props} 
      submitform={this.submitURL}
      {...this.state} /> } }/>
      <Route path={"/main"} component={Main} />
    </Switch>
  </Router>
</div>
    );
  }
}

// export default withRouter (App);
export default App;
